class UnionFind:
    def __init__(self):
        self.parent = {}
        self.rank = {}
        self.count = 0

    def find(self, p):
        if p not in self.parent:
            self.parent[p] = p
            self.rank[p] = 0
            self.count += 1
        else:
            if self.parent[p]!= p:
                self.parent[p] = self.find(self.parent[p])
        return self.parent[p]

    def union(self, p, q):
        rootP = self.find(p)
        rootQ = self.find(q)
        if rootP!= rootQ:
            if self.rank[rootP] < self.rank[rootQ]:
                self.parent[rootP] = rootQ
            else:
                self.parent[rootQ] = rootP
                if self.rank[rootP] == self.rank[rootQ]:
                    self.rank[rootP] += 1
            self.count -= 1

class Solution:
    def numIslands2(self, m: int, n: int, positions: List[List[int]]) -> List[int]:
        uf = UnionFind()
        directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]
        result = []

        for pos in positions:
            r, c = pos
            key = r * n + c
            if key in uf.parent:
                result.append(uf.count)
                continue

            uf.find(key)
            for dr, dc in directions:
                nr, nc = r + dr, c + dc
                nkey = nr * n + nc
                if 0 <= nr < m and 0 <= nc < n and nkey in uf.parent:
                    uf.union(key, nkey)
            result.append(uf.count)

        return result

